"114068":{"id":"114068","name":"A Oferta","slug":"a-oferta","original_title":"The Offer","overview":"Incomodado pela exposição da trama sobre a família Corleone, Joe Colombo, um dos chefes da máfia de Nova Iorque, tenta dar fim à produção, ameaçando os produtores. Mesmo correndo riscos, Albert se nega a interromper o grande projeto de sua vida.","first_air_date":"2022-04-28","episode_run_time":540,"vote_average":7.963,"number_of_seasons":1,"number_of_episodes":10,"created_by":["Michael Tolkin"],"production_companies":["DXD Films","The White Mountain Company","Black Mass Productions","Paramount Television Studios"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/HymZHeOUxDT7QWCgdRsYVcdK7I.jpg","poster_path":"https://image.tmdb.org/t/p/original/9fdYX5uc3HZEuYotms3XJ72AbCr.jpg","cast":["Miles Teller","Matthew Goode","Dan Fogler","Burn Gorman","Colin Hanks"],"trailer":"lpgeHb6y3TM","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9fdYX5uc3HZEuYotms3XJ72AbCr.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9fdYX5uc3HZEuYotms3XJ72AbCr.jpg","air_date":"2022-04-28","episode_count":10,"overview":"N/A","vote_average":7.9,"episodes":{"1":{"name":"Um Lugar à Mesa","overview":"Depois de largar seu emprego na Rand Corporation por uma chance em Hollywood, Al Ruddy ganha o trabalho de produzir o romance best-seller de Mario Puzo, “O Poderoso Chefão” para a Paramount Pictures. Joe Colombo, um chefe do crime em ascensão na máfia de Nova York, tem um destino mais sombrio em mente para o filme.","air_date":"2022-04-28","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/qP7ok5yJyGKCQipgNVEDXfE3lXM.jpg","vote_average":7.3},"2":{"name":"Disparos de Aviso","overview":"Com Francis Ford Coppola e Mario Puzo escrevendo o roteiro, Al Ruddy e Bettye McCartt enfrentam uma lista cada vez maior de oposição a “O Poderoso Chefão”, incluindo Frank Sinatra, LA Gangster Mickey Cohen e a Liga ítalo-americana dos Direitos Civis, liderada por Colombo. Enquanto isso, Robert Evans e Barry Lapidus, da Gulf & Western, discutem a direção criativa da Paramount Pictures.","air_date":"2022-04-28","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/tR31gpB7CtHOu467LkztcTLJLtQ.jpg","vote_average":7.2},"3":{"name":"Aparecimento Gradual","overview":"A pressão aumenta para a entrega dos roteiros depois que Ruddy é forçado a se sentar com Joe Colombo e Evans se vê navegando em águas quentes com o CEO da Gulf & Western, Charlie Bluhdorn. Enquanto isso, Bluhdorn se interessa por Bettye.","air_date":"2022-04-28","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/i08vdjWGfhIeyeS8C74m2t1Fi8y.jpg","vote_average":8.125},"4":{"name":"O Tom Certo de Amarelo","overview":"Com Marlon Brando e Al Pacino na disputa pelos papéis principais em “O Poderoso Chefão”, Ruddy é pego na linha de fogo entre Evans e Coppola e deve escolher um lado. Depois de ganhar o apoio de Joe Colombo, Ruddy tem um vislumbre desconfortável da lealdade de seu novo amigo. As apostas crescentes em torno de \"O Poderoso Chefão\" continuam a prejudicar o relacionamento de Ruddy com Françoise.","air_date":"2022-05-05","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/g54z9IJGH2viE5ivraEEk5qRzHY.jpg","vote_average":8},"5":{"name":"Beije o Anel","overview":"Ruddy e Bettye combatem pesadelos logísticos com a fotografia principal se aproximando rapidamente. À medida que a máfia continua a se enraizar na produção do filme, as tensões aumentam entre Colombo e o notório louco Joe Gallo.","air_date":"2022-05-12","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/aYi4NN14XFLNK9jSuzaLz92xgX0.jpg","vote_average":8},"6":{"name":"Um Cara de Pé","overview":"Ruddy lida com as consequências da desastrosa conferência de imprensa enquanto Evans cria um plano para salvar a Paramount. Bettye entra em ação quando o primeiro dia de filmagem é comprometido devido a colisões com a Gulf & Western, Paramount e a Máfia.","air_date":"2022-05-19","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/H6rfOWMFvG4zEzZiDDWGdEkeXt.jpg","vote_average":8.286},"7":{"name":"Sr. Produtor","overview":"Insatisfeito com a filmagem, Barry Lapidus orquestra um potencial golpe enquanto Ruddy inicia um plano ousado para salvar os empregos de Coppola e Pacino. O chefe do crime, Carlo Gambino, questiona a liderança de Colombo enquanto ele realiza outro grande comício da Liga dos Direitos Civis ítalo-americanos.","air_date":"2022-05-26","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/jK3z8rWS8xAOsJ2Ed2Za81mucvm.jpg","vote_average":8.5},"8":{"name":"Episódio 8","overview":"N/A","air_date":"2022-06-02","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/1zX8l0qBfXRz9Ddx4YifY8OzPGe.jpg","vote_average":8},"9":{"name":"Episódio 9","overview":"N/A","air_date":"2022-06-09","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/3nehbHFCxmWyBhnUJ7XoHVnXraL.jpg","vote_average":7.286},"10":{"name":"Episódio 10","overview":"N/A","air_date":"2022-06-16","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/vpRjKBfon9ORhWh5qb3GGg20gU2.jpg","vote_average":8}}}}},
